{
  "name": "toolkit-deploy",
  "env": {
      "DATABASE_URL": {
          "description": "URL for your Postgres database"
      },
      "COHERE_API_KEY": {
          "description": "Your Cohere API key"
      },
      "INSTALL_COMMUNITY_DEPS": {
          "description": "Whether to enable community features true/false"
      }
  },
  "hooks": {
        "prebuild": {
            "commands": [
                "gcloud auth configure-docker"
            ]
        },
        "postcreate": {
            "commands": [
                "chmod +x ./gcp_postcreate_hook.sh",
                "./gcp_postcreate_hook.sh"
            ]
        }
  },
  "options": {
      "allow-unauthenticated": true,
      "memory": "12288Mi",
      "cpu": "4",
      "port": 4000,
      "max-instances": 2
  }
}

{
  "$schema": "https://schema.management.azure.com/schemas/2019-04-01/deploymentTemplate.json#",
  "contentVersion": "1.0.0.0",
  "resources": [
	{
		"type": "Microsoft.OperationalInsights/workspaces",
		"apiVersion": "2022-10-01",
		"name": "[parameters('containerAppLogAnalyticsName')]",
		"location": "[parameters('location')]",
		"properties": {
			"sku": {
				"name": "PerGB2018"
			}
		}
	},
	{
		"type": "Microsoft.App/managedEnvironments",
		"apiVersion": "2023-11-02-preview",
		"name": "[parameters('containerAppEnvName')]",
		"location": "[parameters('location')]",
		"sku": {
			"name": "Consumption"
		},
		"properties": {
			"appLogsConfiguration": {
				"destination": "log-analytics",
				"logAnalyticsConfiguration": {
					"customerId": "[reference(resourceId('Microsoft.OperationalInsights/workspaces', parameters('containerAppLogAnalyticsName'))).customerId]",
					"sharedKey": "[listKeys(resourceId('Microsoft.OperationalInsights/workspaces', parameters('containerAppLogAnalyticsName')), '2022-10-01').primarySharedKey]"
				}
			}
		},
		"dependsOn": [
			"[resourceId('Microsoft.OperationalInsights/workspaces', parameters('containerAppLogAnalyticsName'))]"
		]
	},
	{
		"type": "Microsoft.App/containerApps",
		"apiVersion": "2022-06-01-preview",
		"name": "[parameters('containerAppName')]",
		"location": "[parameters('location')]",
		"properties": {
			"managedEnvironmentId": "[resourceId('Microsoft.App/managedEnvironments', parameters('containerAppEnvName'))]",
			"configuration": {
				"ingress": {
					"external": true,
					"targetPort": "[parameters('targetPort')]",
					"allowInsecure": false,
					"traffic": [
						{
							"latestRevision": true,
							"weight": 100
						}
					]
				}
			},
			"template": {
				"containers": [
					{
						"name": "[parameters('containerAppName')]",
						"image": "[parameters('image')]",
						"resources": {
							"cpu": "[json(parameters('cpuCore'))]",
							"memory": "[format('{0}Gi', parameters('memorySize'))]"
						},
						"env": [
                            {
                                "name": "DATABASE_URL",
                                "value": "[parameters('databaseUrl')]"
                            },
                            {
                                "name": "COHERE_API_KEY",
                                "value": "[parameters('cohereApiKey')]"
                            }
                        ]
					}
				],
				"scale": {
					"minReplicas": "[parameters('minReplicas')]",
					"maxReplicas": "[parameters('maxReplicas')]",
					"rules": [
						{
							"name": "http-scale-rule",
							"http": {
								"metadata": {
									"concurrentRequests": "100"
								}
							}
						}
					]
				}
			}
		},
		"dependsOn": [
			"[resourceId('Microsoft.App/managedEnvironments', parameters('containerAppEnvName'))]"
		]
	}
  ],
  "parameters": {
	"containerAppName": {
		"type": "string",
		"defaultValue": "[format('toolkit-app-{0}', uniqueString(resourceGroup().id))]",
		"metadata": {
		"description": "Specifies the name of the container app."
		}
	},
	"containerAppEnvName": {
		"type": "string",
		"defaultValue": "[format('toolkit-env-{0}', uniqueString(resourceGroup().id))]",
		"metadata": {
		"description": "Specifies the name of the container app environment."
		}
	},
	"containerAppLogAnalyticsName": {
		"type": "string",
		"defaultValue": "[format('toolkit-log-{0}', uniqueString(resourceGroup().id))]",
		"metadata": {
		"description": "Specifies the name of the log analytics workspace."
		}
	},
	"location": {
		"type": "string",
		"defaultValue": "[resourceGroup().location]",
		"metadata": {
		"description": "Specifies the location for all resources."
		}
	},
	"targetPort": {
		"type": "int",
		"defaultValue": 4000,
		"metadata": {
		"description": "Specifies the container port."
		}
	},
	"cpuCore": {
		"type": "string",
		"defaultValue": "2",
		"allowedValues": [
		"0.25",
		"0.5",
		"0.75",
		"1",
		"1.25",
		"1.5",
		"1.75",
		"2"
		],
		"metadata": {
		"description": "Number of CPU cores the container can use. Can be with a maximum of two decimals."
		}
	},
	"memorySize": {
		"type": "string",
		"defaultValue": "4",
		"allowedValues": [
		"0.5",
		"1",
		"1.5",
		"2",
		"3",
		"3.5",
		"4"
		],
		"metadata": {
		"description": "Amount of memory (in gibibytes, GiB) allocated to the container up to 4GiB. Can be with a maximum of two decimals. Ratio with CPU cores must be equal to 2."
		}
	},
	"minReplicas": {
		"type": "int",
		"defaultValue": 1,
		"maxValue": 2,
		"minValue": 0,
		"metadata": {
		"description": "Minimum number of replicas that will be deployed"
		}
	},
	"maxReplicas": {
		"type": "int",
		"defaultValue": 1,
		"maxValue": 2,
		"minValue": 0,
		"metadata": {
		"description": "Maximum number of replicas that will be deployed"
		}
	},
    "image": {
      "type": "string",
      "defaultValue": "ghcr.io/cohere-ai/cohere-toolkit-proxy",
      "metadata": {
        "description": "Docker image to deploy"
      }
    },
    "databaseUrl": {
      "type": "string",
      "metadata": {
        "description": "Your Database connection URL"
      }
    },
    "cohereApiKey": {
      "type": "string",
      "metadata": {
        "description": "Your Cohere API key for the application"
      }
    }
  }
}

{
    "$schema": "https://schema.management.azure.com/schemas/2019-04-01/deploymentTemplate.json#",
    "contentVersion": "1.0.0.0",
    "parameters": {
        "utcValue": {
            "type": "string",
            "defaultValue": "[utcNow('yyyyMMddHHmmss')]",
            "metadata": {
                "description": "The UTC value."
            }
        },
        "availabilityZones": {
            "type": "array",
            "defaultValue": [],
            "metadata": {
                "description": "The availability zones for the container group."
            }
        },
        "location": {
            "type": "string",
            "defaultValue": "[resourceGroup().location]",
            "metadata": {
                "description": "The location for the container group.  Don't change this value!"
            }
        },
        "containerName": {
            "type": "string",
            "defaultValue": "cohere-toolkit",
            "metadata": {
                "description": "The name of the container."
            }
        },
        "imageType": {
            "type": "string",
            "allowedValues": [
                "Public",
                "Private"
            ],
            "defaultValue": "Private",
            "metadata": {
                "description": "The type of Docker image."
            }
        },
        "imageName": {
            "type": "string",
            "defaultValue": "ghcr.io/cohere-ai/cohere-toolkit",
            "metadata": {
                "description": "The name of the Docker image."
            }
        },
        "osType": {
            "type": "string",
            "allowedValues": [
                "Linux",
                "Windows"
            ],
            "defaultValue": "Linux",
            "metadata": {
                "description": "The operating system type."
            }
        },
        "numberCpuCores": {
            "type": "string",
            "defaultValue": "3",
            "metadata": {
                "description": "The number of CPU cores."
            }
        },
        "memory": {
            "type": "string",
            "defaultValue": "8",
            "metadata": {
                "description": "The amount of memory in GB."
            }
        },
        "restartPolicy": {
            "type": "string",
            "allowedValues": [
                "OnFailure",
                "Always",
                "Never"
            ],
            "defaultValue": "OnFailure",
            "metadata": {
                "description": "The restart policy for all containers within the container group."
            }
        },
        "sku": {
            "type": "string",
            "allowedValues": [
                "Standard",
                "Confidential"
            ],
            "defaultValue": "Standard",
            "metadata": {
                "description": "The SKU of the container group."
            }
        },
        "cohereApiKey": {
            "type": "secureString",
            "metadata": {
                "description": "The API key for the Cohere API."
            }
        },
        "frontendPort": {
            "type": "string",
            "defaultValue": "4000",
            "metadata": {
                "description": "The port of the frontend."
            }
        },
        "backendPort": {
            "type": "string",
            "defaultValue": "8000",
            "metadata": {
                "description": "The port of the backend API."
            }
        },
        "ipAddressType": {
            "type": "string",
            "allowedValues": [
                "Public",
                "Private"
            ],
            "defaultValue": "Public",
            "metadata": {
                "description": "The type of IP address."
            }
        },
        "ports": {
            "type": "array",
            "defaultValue": [
                {
                    "port": 8000,
                    "protocol": "TCP"
                },
                {
                    "port": 4000,
                    "protocol": "TCP"
                }
            ],
            "metadata": {
                "description": "The ports for the container group."
            }
        },
        "dnsNameLabel": {
            "type": "string",
            "defaultValue": "toolkit-app",
            "metadata": {
                "description": "The DNS name label for the container."
            }
        },
        "autoGeneratedDomainNameLabelScope": {
            "type": "string",
            "defaultValue": "Unsecure",
            "metadata": {
                "description": "The scope of the auto-generated domain name label."
            }
        }
    },
    "resources": [
        {
            "location": "[parameters('location')]",
            "name": "[parameters('containerName')]",
            "type": "Microsoft.ContainerInstance/containerGroups",
            "apiVersion": "2021-09-01",
            "zones": "[parameters('availabilityZones')]",
            "properties": {
                "containers": [
                    {
                        "name": "[parameters('containerName')]",
                        "properties": {
                            "image": "[parameters('imageName')]",
                            "resources": {
                                "requests": {
                                    "cpu": "[int(parameters('numberCpuCores'))]",
                                    "memoryInGB": "[float(parameters('memory'))]"
                                }
                            },
                            "environmentVariables": [
                                {
                                    "name": "COHERE_API_KEY",
                                    "secureValue": "[parameters('cohereApiKey')]"
                                },
                                {
                                    "name": "NEXT_PUBLIC_API_HOSTNAME",
                                    "value": "[concat('http://',parameters('dnsNameLabel'),'-',parameters('utcValue'),'.',parameters('location'),'.azurecontainer.io',':',parameters('backendPort'))]"
                                },
                                {
                                    "name": "PORT",
                                    "value": "[parameters('frontendPort')]"
                                }
                            ],
                            "ports": "[parameters('ports')]"
                        }
                    }
                ],
                "restartPolicy": "[parameters('restartPolicy')]",
                "osType": "[parameters('osType')]",
                "sku": "[parameters('sku')]",
                "ipAddress": {
                    "type": "[parameters('ipAddressType')]",
                    "ports": "[parameters('ports')]",
                    "dnsNameLabel": "[concat(parameters('dnsNameLabel'),'-',parameters('utcValue'))]",
                    "autoGeneratedDomainNameLabelScope": "[parameters('autoGeneratedDomainNameLabelScope')]"
                }
            },
            "tags": {}
        }
    ]
}

